import React from 'react'
import ReactEcharts from 'echarts-for-react'
import topic0 from "assets/img/logo/logo_3.png"
import {
  CardImg
} from 'reactstrap';

class TopicsChart extends React.Component {

    getOption = () => ({
        title: {
            subtext: 'Artigos estigmatizantes',

            left: 'center'
          },
          tooltip: {
            trigger: 'item',
            formatter: '{a} <br/>{b} : {c} ({d}%)'
          },
          legend: {
            bottom: 10,
            left: 'center',
            data: ['CityA', 'CityB', 'CityD', 'CityC', 'CityE']
          },
          series: [
            {
              type: 'pie',
              radius: '65%',
              center: ['50%', '50%'],
              selectedMode: 'single',
              data: [
                {
                  value: 1548,
                  name: 'CityE',

                },
                { value: 735, name: 'CityC' },
                { value: 510, name: 'CityD' },
                { value: 434, name: 'CityB' },
                { value: 335, name: 'CityA' }
              ],
              emphasis: {
                itemStyle: {
                  shadowBlur: 10,
                  shadowOffsetX: 0,
                  shadowColor: 'rgba(0, 0, 0, 0.5)'
                }
              }
            }
          ]
      });

      render(){
        return (
            <ReactEcharts
                option={this.getOption()}
                style={{ height: "500px", width: "1200px", marginLeft:"0px", marginTop:"30px"}}
            />
        );
      }




}

export default TopicsChart
